import React from "react";
import "./Banner.scss";

const Banner = () => {
  return (
    <div className="banner">
      <div>
        <img
          src="./image/banner.png"
          alt="Miss Dior Banner 1"
          className="banner-image"
        />
      </div>
    </div>
  );
};

export default Banner;
